function fetchRequestGetNetworkDevices() {
    return fetch(`/api/networkList`, {method: 'GET'})
        .then((response) => response.json())
        .then((data) => {
            return data
        })
}

function fetchRequestPingList() {
    return fetch(`/api/pingList`, {method: 'GET'})
        .then((response) => response.json())
        .then((data) => {
            return data
        })
}

function fetchRequestAddNetworkDevice(device) {
    let base64 = document.querySelectorAll('.outputImage')[1].src
    return urltoFile(base64, base64.slice(10, 20))
        .then(function (file) {
            let data = new FormData()
            data.append('image', file)
            data.append('name', device.name)
            data.append('ip', device.ip)
            data.append('workers', device.workers)
            data.append('location', device.location)
            data.append('description', device.description)

            return fetch('/api/addNetwork', {
                method: 'POST',
                body: data
            })
                .then(response => response.text())
        });
}

function fetchRequestChangeNetworkDevice(device) {
    let base64 = document.querySelectorAll('.outputImage')[1].src
    return urltoFile(base64, base64.slice(10, 20))
        .then(function (file) {
            let data = new FormData()
            data.append('image', file)
            data.append('name', device.name)
            data.append('ip', device.ip)
            data.append('workers', device.workers)
            data.append('location', device.location)
            data.append('description', device.description)

            return fetch('/api/updateNetwork', {
                method: 'PUT',
                body: data
            })
                .then(response => response.text())
        });
}

function fetchRequestDeleteNetworkDevice(device) {
    return fetch(`/api/deleteNetwork-${device}`, {method: 'DELETE'})
        .then(response => response.text())
        .then((result) => {
            return result
        })
        .catch(error => console.log('Ошибка при отправке запроса', error));
}

function fetchRequestListPhoto(listTabels) {
    return fetch(`/api/photoList-${listTabels}`, {method: 'GET'})
        .then(response => response.json())
        .then((result) => {
            return result
        })
        .catch(error => console.log('Ошибка при отправке запроса', error));
}

function lastConnectTime(time) {
    time = new Date() - new Date(time).getTime()
    return msToTimeDays(time).slice(2)
}

function getCorrectIP(ip) {

    let correctIP = '192.168.'
    if (ip.length <= 8) return correctIP.slice(0, ip.length)

    let array = ip.slice(8).split('.')
    let ipNew
    array = array.map(e => {
        if (0 <= +e && +e <= 255) {
            return +e
        } else if (array.length == 1) {
            return (+e > 255) ? '255.' : '0.'
        } else return (+e > 255) ? 255 : 0
    })

    if (array.length == 2 && ip[ip.length - 1] !== '.') {
        ipNew = array[0] + '.' + array[1]
    } else if (array.length > 2) {
        ipNew = array[0] + '.' + array[1]
    } else ipNew = (ip[ip.length - 1] == '.') ? array[0] + '.' : array[0]

    return correctIP + ipNew
}

function checkIP(ip) {

    if (ip.length <= 8) return false

    let array = ip.slice(8).split('.')

    array = array.map(e => {
        if (0 <= +e && +e <= 255) {
            return +e
        } else return false
    })

    if (array.length == 2 && ip[ip.length - 1] !== '.' && !array.includes(false)) {
        return true
    } else return false

}

function Network() {

    let undefImg = ''

    let humanEx = ''


    const [typeForm, setTypeForm] = useState('hide')
    const [clickedDeleteButton, setClickedDeleteButton] = useState(true)
    const [errorMessage, setErrorMessage] = useState(['', ''])
    const [tableBody, setTableBody] = useState(null)
    const [machine, setMachine] = useState(
        {
            name: '',
            ip: '192.168.',
            photo: undefImg,
            ping: 'false',
            lastPolling: null,
            workers: '',
            location: '',
            description: ''
        })
    const [tabelList, setTabelList] = useState(null)

    let firstInterval
    let secondInterval

    function handleOnChange(e, key) {
        const {value} = e.target;
        setMachine(prevState => ({
            ...prevState,
            [key]: value
        }));
    };

    function handleOnChangeIP(e) {
        const {value} = e.target;
        setMachine(prevState => ({
            ...prevState,
            ['ip']: getCorrectIP(value)
        }));
    };

    function handleOnChangeImage(file) {
        let reader = new FileReader();
        reader.readAsDataURL(file);
        reader.onload = function () {
            setMachine(prevState => ({
                ...prevState,
                ['photo']: reader.result.substr(reader.result.indexOf(',') + 1)
            }));
        };


    };

    function updateTable(fullRequest) {

        let countInterval = 0
        secondInterval = setInterval(() => {

            let url = window.location.href
            url.includes('network') ? null : clearInterval(secondInterval)

            if ((tableBody == null || fullRequest) && countInterval == 0) {
                let promiseDeviceData = fetchRequestGetNetworkDevices()
                promiseDeviceData.then(data => {
                    console.log('Первая загрузка')
                    let dataArray = Object.keys(data).map(e => {
                        return data[e]
                    })
                    setTableBody(dataArray)

                    let tabels = dataArray.map(e => (e.workers).split(','))
                    tabels = tabels[0].concat(...tabels.slice(1)).filter(f => (!isNaN(+f)));
                    tabels = tabels.map(e => (e.replace(' ', '')))

                    let promisePhotoList = fetchRequestListPhoto(tabels.join())
                    promisePhotoList.then(photos => {
                        setTabelList(photos.photo)
                    })

                })
            } else if (tableBody !== null && countInterval < 10) {
                console.log(countInterval, timeNow())
                const newState = tableBody.map((obj, i) => {
                    return {...obj, lastPolling: new Date(obj.lastPolling) + 1000};
                });
                setTableBody(newState);
            } else if (countInterval == 10 && tableBody !== null) {
                let promiseDeviceData = fetchRequestPingList()
                promiseDeviceData.then(data => {
                    console.log('Запрос раз в 10 секунд')
                    let dataArray = Object.keys(data).map(e => {
                        return data[e]
                    })

                    const newState = tableBody.map((obj, i) => {
                        if (obj.name == dataArray[i].name) {
                            return {...obj, lastPolling: dataArray[i].lastPool, ping: dataArray[i].ping};
                        }
                        return obj;
                    });
                    setTableBody(newState);
                    clearInterval(secondInterval)
                })
            }

            countInterval++
            countInterval >= 12 ? clearInterval(secondInterval) : null
        }, 1000)

    }

    useEffect(() => {
        if (tableBody == null) {
            console.log('Первый старт', timeNow())
            updateTable(true)
        }
        firstInterval = setInterval(() => {
            console.log('новый интервал', timeNow())
            updateTable()
        }, 1500)

        return () => {
            clearInterval(firstInterval)
            // clearInterval(secondInterval)
        }


    }, [tableBody])

    return (
        <div className={'networkWrap'}>
            <NetworkButtonAdd typeForm={typeForm} setTypeForm={setTypeForm}
                              setErrorMessage={setErrorMessage}/>
            <table className={`networkTable scudMonthMainTable`}>
                <thead>
                <tr>
                    <th>№</th>
                    <th>Изображение</th>
                    <th>Наименование</th>
                    <th>IP адрес</th>
                    <th>Сотрудники</th>
                    <th>Расположение</th>
                    <th>Описание</th>
                    <th>Последний опрос</th>
                    <th>Связь</th>
                </tr>
                </thead>
                <tbody>
                {tableBody == null ? null :
                    tableBody.map((deviceTable, i) => {
                        return (
                            <tr key={i}>
                                <td>{i + 1}</td>
                                <td>
                                    <div className={'networkImageBlock'}>
                                        <img
                                            src={`data:image/jpeg;base64,${deviceTable.photo}`}
                                            alt=""
                                        />
                                    </div>
                                </td>
                                <td>{deviceTable.name}</td>
                                <td>{deviceTable.ip}</td>
                                <td>
                                    <ImageList imageList={deviceTable.workers} tabelList={tabelList} humanEx={humanEx}/>
                                </td>
                                <td>{deviceTable.location}</td>
                                <td>{deviceTable.description}</td>
                                <td>{lastConnectTime(deviceTable.lastPolling)}</td>
                                <td>
                                    <span
                                        className={`${deviceTable.ping == 'true' ? 'statusActive' : 'statusNoActive'} sizeStatusActive`}></span>
                                </td>
                                <td className={'changeAddTd'}>
                                    <div className='tdChange' onClick={() => {
                                        setMachine(deviceTable)
                                        setErrorMessage(['', ''])
                                        if (machine.name == deviceTable.name && typeForm == 'change') {
                                            setTypeForm('hide')
                                            setErrorMessage('', '')
                                        } else {
                                            setTypeForm('change')
                                            setErrorMessage(['', ''])
                                        }
                                    }}></div>
                                    <div className={`tdDelete ${clickedDeleteButton ? '' : 'noActiveButton'}`}
                                         onClick={() => {
                                             if (window.confirm(`Вы уверены, что хотите удалить оборудование ${deviceTable.name}?`)) {
                                                 let deletePromise = fetchRequestDeleteNetworkDevice(deviceTable.name)
                                                 deletePromise.then((answer) => {
                                                     if (answer == 'ok') {
                                                         setClickedDeleteButton(false)
                                                         setTimeout(() => {
                                                             setClickedDeleteButton(true)
                                                         }, 1000)
                                                         window.location.reload()
                                                     } else alert('Недостаточно прав для удаления')
                                                 })
                                             }
                                         }}></div>
                                </td>
                            </tr>
                        )
                    })
                }
                </tbody>
            </table>

            <NetworkFormUpdateAdd typeForm={typeForm} machine={machine} handleOnChange={handleOnChange}
                                  handleOnChangeIP={handleOnChangeIP} handleOnChangeImage={handleOnChangeImage}
                                  errorMessage={errorMessage} setErrorMessage={setErrorMessage}/>
            <div className={typeForm == 'hide' ? null : 'darkSpace'}
                 onClick={() => {
                     setTypeForm('hide')
                     setErrorMessage(['', ''])
                 }}></div>
        </div>
    )
}

function NetworkFormUpdateAdd({
                                  typeForm, machine, handleOnChange, handleOnChangeIP,
                                  handleOnChangeImage, errorMessage, setErrorMessage
                              }) {
    return (
        <form className={`networkFormAdd ${classToTypeForm(typeForm)}`}>
            <p className='formAdminName'>{typeForm == 'change' ? 'Редактирование оборудования' : 'Добавление оборудования'}</p>

            <label htmlFor="">Наименование {typeForm == 'change' ? machine.name : null}</label>
            <input className={`adminInput ${typeForm == 'change' ? 'formHideUsersControl' : null}`}
                   value={machine.name}
                   type={'text'}
                   placeholder={'Наименование оборудования'}
                   onChange={(e) => {
                       handleOnChange(e, 'name')
                   }}/>
            <label htmlFor="">IP адрес {}</label>
            <input className={`adminInput`}
                   value={machine.ip}
                   type={'text'}
                   placeholder={'192.168.1.1'}
                   onChange={(e) => {
                       handleOnChangeIP(e)
                   }}/>

            <label htmlFor="">Сотрудники</label>
            <input className={`adminInput`}
                   value={machine.workers}
                   type={'text'}
                   placeholder={'1234, 4321...'}
                   onChange={(e) => {
                       handleOnChange(e, 'workers')
                   }}/>

            <label htmlFor="">Расположение</label>
            <input className={`adminInput`}
                   value={machine.location}
                   type={'text'}
                   placeholder={'2 площадка'}
                   onChange={(e) => {
                       handleOnChange(e, 'location')
                   }}/>

            <label htmlFor="">Описание</label>
            <textarea className={`adminInput`}
                      value={machine.description}
                      type={'text'}
                      maxLength={500}
                      placeholder={'Описание оборудования'}
                      onChange={(e) => {
                          handleOnChange(e, 'description')
                      }}/>

            <div className="profile-pic">
                <label className="-label" htmlFor="userAvatar">
                    <span className='adminPhotoMessage'>Поменять изображение</span>
                </label>
                <input
                    className="inputImage"
                    id="userAvatar"
                    type="file"
                    onChange={() => {
                        let input = document.getElementById('userAvatar')
                        handleOnChangeImage(input.files[0])
                    }}
                />
                <img
                    className="outputImage imageBackground"
                    src={`data:image/jpeg;base64,${machine.photo}`}
                    width="200"
                />
            </div>

            <button className={'formAddChangeButton'} type="button"
                    onClick={() => {
                        if (machine.name == '' || machine.ip == '' || machine.workers == '' || machine.location == '' || machine.description == '') {
                            setErrorMessage(['Заполните все поля', 'redMessage'])
                            return null
                        }
                        if (!checkIP(machine.ip)) {
                            setErrorMessage(['Введите корректный IP', 'redMessage'])
                            return null
                        }
                        if (typeForm == 'add') {
                            let addPromise = fetchRequestAddNetworkDevice(machine)
                            addPromise.then((data) => {
                                if (data == 'ok') {
                                    setErrorMessage(['Оборудование добавлено', 'greenMessage'])
                                    window.location.reload()
                                } else setErrorMessage(['Не удалось добавить оборудование', 'redMessage'])
                            })
                        } else if (typeForm == 'change') {
                            let changePromise = fetchRequestChangeNetworkDevice(machine)
                            changePromise.then((data) => {
                                if (data == 'ok') {
                                    setErrorMessage(['Оборудование изменено', 'greenMessage'])
                                    window.location.reload()
                                } else setErrorMessage(['Не удалось изменить оборудование', 'redMessage'])
                            })
                        }
                    }}>{typeForm == 'add' ? 'Добавить' : 'Изменить'}
            </button>
            <p className={`errorMessage ${errorMessage[1]}`}>{errorMessage[0]}</p>
        </form>
    )
}


function ImageList({imageList = "1234", tabelList, humanEx}) {

    function returnPhoto(tabel) {
        return tabelList[tabel] ? tabelList[tabel] : humanEx
    }

    useEffect(() => {
    }, [tabelList])

    return (
        <div className={'imageListWrapper'}>
            {
                imageList.split(',').map((tabel, i) => (
                    <div key={i}>
                        <label>
                            <span>{tabel}</span>
                        </label>
                        <img key={i}
                             src={`data:image/jpeg;base64,${tabelList == null ? humanEx : returnPhoto(tabel)}`}
                        />
                    </div>
                ))
            }
        </div>
    )
}

function NetworkButtonAdd({typeForm, setTypeForm, setErrorMessage}) {

    return (
        <div className='networkAddButton' onClick={() => {
            if (typeForm == 'add') {
                setTypeForm('hide')
                setErrorMessage(['', ''])
            } else setTypeForm('add')
        }}>
            <span>Добавить оборудование</span>
        </div>
    )
}